import React, { Component } from 'react';
import axios from 'axios';
import { Bar } from 'react-chartjs-2';
import Tabledata from './Tabledata';

class Wbnx1 extends Component {
    state={
        data : [],
        result: [],
        isLoading: true,
        errcode: 'Loading...',
        timestamp: [],
    };

    getdata = async () =>{
        console.log("Requesting Data!");
        await axios.get('http://somweb.cf:8000/wbn-x1-r0')
        .then((data) => {
            console.log('Data Check!');
            const mydata = data.data.data;
            return this.setState({data:mydata, isLoading: false});
        }).catch(()=>{
            alert('SERVER ERROR');
            this.setState({errcode:'주임님 서버좀...'});
        })
    }
    gettimer = () =>{
        console.log("Time Start!");

        let time = new Date();
        let years = time.getFullYear();
        let month = time.getMonth();
        let date = time.getDate();
        let hours = time.getHours();
        let minutes = time.getMinutes();
        let seconds = time.getSeconds();

        const result = ` : (${hours}:${minutes}:${seconds}) ${years}-${month+1}-${date}`;

        return this.setState({result:result});
    }
    getstamp = () =>{
        axios.get('http://somweb.cf:8000/wbn-timestamp').then(response=>{
            const x = response.data.data;
            console.log('최신 데이터 시간을 업데이트하였습니다.');
            return this.setState({timestamp : x});
        }).catch(()=>{
            alert('SERVER ERROR');
            this.setState({errcode:'주임님 서버좀...'});
        })
    }
    componentDidMount(){
        this.getdata();
        this.gettimer();
        this.getstamp();
    }
    renderbtn = () => {
        this.getdata();
        this.gettimer();
        this.getstamp();
        alert('데이터를 새로고침하였습니다.');
    }
    
    render() {
        const {data, result,isLoading, errcode, timestamp} = this.state;
        const tt = timestamp.map(data=>{
            const y = data.timestamp;
            return (<p>Obserused Time : {y}</p>);
        });
        const chartdata = {
            labels:['IN','Out','Total'],
            datasets:[
                {
                    label: 'WBN_X1(R0)',
                    data: [12,19,3],
                    backgroundColor: [
                        'rgba(255, 99, 132, 0.2)',
                        'rgba(54, 162, 235, 0.2)',
                        'rgba(255, 206, 86, 0.2)',
                    ],
                    borderColor: [
                        'rgba(255, 99, 132, 1)',
                        'rgba(54, 162, 235, 1)',
                        'rgba(255, 206, 86, 1)',
                    ],
                    borderWidth: 1,
                },
            ],
        };
        const test = data.filter(data => {
            return data[0] > [20];
        });
        console.log(test);
        console.log(data[0]);
        return (
            <div className="table">
                {isLoading ? <div className="loader">
                    <span className="loader__text">{errcode}</span>
                </div> :
                (
                    <div className="container">
                        <div className="spantitle">
                            <h2> Network Node : WBN_X1(R0) </h2>
                            {tt}
                            <div className="itembox">
                                <button onClick={this.renderbtn}>Start Time Measued</button>
                                <p>{result}</p>
                            </div>
                        </div>

                        <div className="content">

                            <table className="tableset">
                                <tbody>
                                    <tr>
                                        <td>Time Offset</td>
                                        <td colSpan="3">BandWidth(Mbps)</td>
                                    </tr>
                                    <tr>
                                        <td>offset</td>
                                        <td>IN</td>
                                        <td>Out</td>
                                        <td>Total</td>
                                    </tr>
                                    {
                                        data.map(data => (
                                            <Tabledata 
                                                offset={data.offset}
                                                speed_in={data.speed_in}
                                                speed_out={data.speed_out}
                                                speed_total={data.speed_total}
                                            />
                                        ))
                                    }
                                </tbody>
                            </table>

                            <div className="chart">
                                <Bar data={chartdata}/>
                            </div>

                        </div>
                    </div>
                )
                }
            </div>
        );
    }
}

export default Wbnx1;
